        private static void Register(BlockType type, string displayName, string name, float hardness, float resistance, bool diggable, bool transparent, int filterLight, int emitLight, string boundingbox, int stackSize, string material, int defaultState, int minState, int maxState, Items.ItemType[]? harvestTools) {
            BlockInfo info = new BlockInfo(type, displayName, name, hardness, resistance, diggable, transparent, filterLight, emitLight, boundingbox, stackSize, material, defaultState, minState, maxState, harvestTools);
            Blocks.Add(info);
            for (int i = info.MinStateId; i <= info.MaxStateId; i++) {
                StateToBlockMap.Add(i, Blocks[(int)info.Id]);
            }
        }

